import React, { Component } from "react";
import RapCard from "../Components/RapCard";
import rapperList from "../rapperList";

class RapContainer extends Component {
  state = {
    rappers: rapperList
  };
  render() {
    return <RapCard />;
  }
}

export default RapContainer;
